import React from 'react';
import Home from './components/home'; // Import your Home component
import Resume from './components/Resume';


function App() {
  return (
    <div>
      <Home />
      <Resume />
    </div>
  );
}



<button
  onClick={() => alert('Thanks for visiting my website!')}
  style={{
    padding: '10px 20px',
    fontSize: '16px',
    color: 'white',
    backgroundColor: '#007bff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    marginTop: '20px',
  }}
>
  Click Me!
</button>

export default App;
